    less than 25% of time on FEA. Salary allocation will change post-primary with
    all salary coming from Federal funds. THE AMENDMENT OF OCTOBER 2011 IS IN RESPONSE
    TO A LETTER FROM THE FEC DATED SEPTEMBER 15, 2011, QUESTIONING NEGATIVE BALANCES.
