    AND THE EXPENSE WAS PAID AS PART OF A JUNE 24, 2011 PAYMENT OF R&J PROPERTIES
    OF $2,028 WHICH IS LISTED ON THE JULY MONTHLY REPORT. T.C. ANDERSON, 2011 TREASURER\n"
